import axios from 'axios';
import serverUrl from '../../../../common/constants/urls';

const userPhoto = '/avatar';

async function getUserPhotoAxios() {
  const res = await axios.get(`${serverUrl}${userPhoto}`);
  return res;
}

export default getUserPhotoAxios;
